    false,nt"url": null,nt"notes": "COUNTY_GOVERNMENT_BOUNDARIES_IDHS_IN is
    a polygon shapefile that contains governmental boundaries maintained by county agencies
    in Indiana, provided by personnel of Indiana Department of Homeland Security (IDHS)
    as of June 29, 2009, and subsequently updated on September 30, 2009, December 2,
    2009, December 28, 2009, February 2, 2010, March 5, 2010, April 6, 2010, October
    11, 2010, November 19, 2010, March 22, 2011, September 8, 2011, January 30, 2012,
    June 8, 2012, August 27, 2012, and April 27, 2013. This data set was provided by
    IDHS in ESRI shapefile format and was named "County_Govt_Boundary.shp." This data
    set was compiled by IDHS as part of the IndianaMap Data Sharing Initiative between
    IGIC, Indiana Office of Technology (IOT), Indiana Geographic Information Office
    (GIO), Indiana Department of Homeland Security (IDHS), Indiana Geological Survey
    (IGS) and participating Indiana counties to provide the most accurate framework
    data (including address points, street centerlines, land parcels, and governmental
    boundaries) for the citizens of Indiana. More information is available at the following
    Web URL: http://www.igic.org/news/index.php?itemid=265",nt"license_title":
